import { Video } from "../constants/constants";

export const apiTransform = (searchResults: any) => {
  const videos: Video[] = [];

  searchResults.data.items.map((searchResult: any) => {
    const video = {
      preview: searchResult.snippet.thumbnails.high.url,
      title: searchResult.snippet.title,
      channel: searchResult.snippet.channelTitle,
      views: 0,
    };

    videos.push(video);
  });

  return result;
};
